import React from "react";
import styled from "styled-components";

const StyleCulcolator = styled.div`
    background-color: #718792;
    width: 300px;
    height: 500px;
    margin: auto;
    margin-top: 150px;
`;
const Culcolator = () => {
    return <StyleCulcolator></StyleCulcolator>;
};

export default Culcolator;
